  established a policy to document and post online all CX determinations involving
  classes of actions listed in Appendix B to Subpart D of the DOE NEPA regulations
  (10 CFR Part 1021). This database contains CX determinations required to be posted
  under the policy, and also some for which documentation and posting are optional,
  i.e., determinations involving classes of actions listed in Appendix A or made before
  the policy's effective date of November 2, 2009.\",\n\t\"license_title\": \"Creative
